import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
  <div>
    <h1> ANR Netflix Pick</h1>
    <p> here are the list of my fav 5 netflix series</p>
    <ol>
      <li>Coffee</li>
      <li>Tea</li>
      <li>Milk</li>
    </ol>
    ,
  </div>,
  document.getElementById("root")
);

